CREATE DATABASE simpsons;
USE simpsons;

CREATE TABLE characters (
id INT auto_increment PRIMARY KEY,
name VARCHAR(45) NOT NULL,
gender VARCHAR(20),
ocupation VARCHAR(45)
);

ALTER TABLE characters ADD COLUMN (
image TEXT 
);


